import React, { Component } from 'react';
import { CssBaseline, Container, AppBar, Toolbar, Typography } from '@material-ui/core';

class App extends Component{
  constructor(){
    super();
    this.state = {
      response: false
    };
  }

  render(){
    return (
      <React.Fragment>
        <CssBaseline />
        <Container maxWidth="sm" style={{backgroundColor:"blue"}}>
      <div>
        <AppBar color="primary" position="static">
          <Toolbar>
            <Typography variant="title"
              color="inherit"
            >
              My header
           </Typography>
          </Toolbar>
        </AppBar>
      </div>
      </Container>
      </React.Fragment>
    )
  }


}

export default App;
